import React from "react";

const Projects = () => {
  const projects = [
    {
      title: "NYC Taxi Analysis",
      description: "Data exploration and visualization of NYC taxi trip data, identifying fare patterns, tip percentages, and strategic business recommendations.",
      link: "https://github.com/akshatkashyap/nyc-taxi-analysis"
    },
    {
      title: "Ames Housing Analysis",
      description: "Comprehensive housing data analysis for strategic price recommendations and feature engineering.",
      link: "https://github.com/akshatkashyap/ames-housing-analysis"
    },
    {
      title: "Airbnb Data Analysis",
      description: "In-depth exploration of Airbnb dataset to uncover rental trends, seasonal pricing insights, and recommendation system logic.",
      link: "https://github.com/akshatkashyap/airbnb-data-analysis"
    }
  ];

  return (
    <section className="projects" id="projects">
      <div className="container">
        <h3>Selected Projects</h3>
        <div className="project-list">
          {projects.map((project, index) => (
            <div key={index} className="project-card">
              <h4>{project.title}</h4>
              <p>{project.description}</p>
              <a 
                href={project.link} 
                target="_blank" 
                rel="noopener noreferrer"
              >
                View on GitHub
              </a>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
